import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the cart element using text selector (unique "Cart" text)
    const cartSelector = 'xpath=//div[contains(@class,"cart") and contains(normalize-space(),"Cart")]';
    await page.waitForSelector(cartSelector, { timeout: 5000 });

    // Take screenshot before clicking cart
    const beforeCartClick = path.join(screenshotsDir, 'step_2_before_cart_click.png');
    await page.screenshot({ path: beforeCartClick });
    screenshots.push(beforeCartClick);

    // Click the cart element to open the cart modal
    await page.click(cartSelector);

    // Wait for the cart modal to appear (look for modal-content with cart-content inside)
    const cartModalSelector = 'xpath=//div[contains(@class,"modal-content")]//div[contains(@class,"cart-content") or .//h2[contains(text(),"Cart")]]';
    await page.waitForSelector(cartModalSelector, { timeout: 5000 });

    // Take screenshot of the opened cart modal
    const afterCartOpen = path.join(screenshotsDir, 'step_3_cart_modal_open.png');
    await page.screenshot({ path: afterCartOpen });
    screenshots.push(afterCartOpen);

    // Extract cart modal title to verify
    let cartModalTitle = '';
    try {
      cartModalTitle = await page.$eval(
        'xpath=//div[contains(@class,"modal-content")]//div[contains(@class,"cart-content")]//h2',
        el => el.textContent.trim()
      );
    } catch {
      // fallback: try to get any h2 inside modal-content
      try {
        cartModalTitle = await page.$eval(
          'xpath=//div[contains(@class,"modal-content")]//h2',
          el => el.textContent.trim()
        );
      } catch {
        cartModalTitle = '';
      }
    }

    return {
      success: true,
      action: "Opened the Shopping Cart modal by clicking the cart area",
      extractedData: {
        cartModalTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
